import React from 'react'


const Cart = ({ products, cart }) => {

    return (
        <div className="cart-page">
            {cart.map((product, index) => (
                <div className="incart" key={product.index}>
                    <img src={product.img} alt=""/>
                    <p>{product.title}</p>
                    <p>{product.price}</p>
                </div>
            ))}
        </div>
    )
}

export default Cart
